const employeeData = [
  {
    "first_name": "Alice",
    "last_name": "Adams",
    "devices": [1, 2]
  },
  {
    "first_name": "Bob",
    "last_name": "Bush",
    "devices": [3]
  },
  {
    "first_name": "Chris",
    "last_name": "Carlton",
    "devices": [4]
  },
  {
    "first_name": "Dorian",
    "last_name": "Descartes",
    "devices": [5, 6]
  },
  {
    "first_name": "Esteban",
    "last_name": "Enriquez",
    "devices": [7]
  }
];

const count = (data) => {
  let counter = 0;
  data.forEach((item) => {
    counter++;
  });
  return counter;
};

export {
  employeeData,
  count
};
